import React, { useState } from 'react';
import AddDream from './components/AddDream';
import DreamList from './components/DreamList';
import AnalyzeDream from './components/AnalyzeDream'; // <-- Import your new component

const App = () => {
  const [refresh, setRefresh] = useState(false);
  const [activeTab, setActiveTab] = useState<'add' | 'list' | 'analyze'>('add');

  const handleAdd = () => setRefresh(!refresh);

  return (
    <div className="min-vh-100 bg-light d-flex align-items-center justify-content-center">
      <div className="container p-4 bg-white rounded-4 shadow"   
        style={{
          margin: 50,
          width: 'calc(100vw - 100px)',
          height: 'calc(100vh - 100px)',
          maxWidth: 1000,
          minWidth: 300,
          overflow: 'auto',
        }}>
        <h1 className="display-5 fw-bold mb-4 text-primary text-center">Dream Log ðŸŒ™</h1>

        {/* Tabs */}
        <ul className="nav nav-tabs mb-4">
          <li className="nav-item">
            <button
              className={`nav-link ${activeTab === 'add' ? 'active' : ''}`}
              onClick={() => setActiveTab('add')}
              type="button"
            >
              Add Dream
            </button>
          </li>
          <li className="nav-item">
            <button
              className={`nav-link ${activeTab === 'list' ? 'active' : ''}`}
              onClick={() => setActiveTab('list')}
              type="button"
            >
              Dreams
            </button>
          </li>
          <li className="nav-item">
            <button
              className={`nav-link ${activeTab === 'analyze' ? 'active' : ''}`}
              onClick={() => setActiveTab('analyze')}
              type="button"
            >
              Analyze Dream
            </button>
          </li>
        </ul>

        {/* Tab content */}
        <div>
          {activeTab === 'add' && <AddDream refresh={refresh} onAdd={handleAdd} />}
          {activeTab === 'list' && <DreamList refresh={refresh} />}
          {activeTab === 'analyze' && <AnalyzeDream refresh={refresh} />}
        </div>
      </div>
    </div>
  );
};

export default App;
